import React from "react";

function About() {
  return (
    <div id="about" className="py-16 bg-gray-800 text-white">
      <div className="container mx-auto px-4">
        <h2 className="text-3xl font-bold text-center mb-8">About CMD LLC</h2>
        <div className="max-w-3xl mx-auto text-center">
          <p className="text-gray-300 mb-6">
            Founded in 2024, CMD LLC is a leading digital services provider
            based in the creative heart of Bandung City, Indonesia. We combine
            innovation with expertise to deliver exceptional digital solutions.
          </p>
          <p className="text-gray-300">
            Our commitment to excellence and cutting-edge technology ensures
            that we stay ahead in the digital landscape while providing the best
            solutions for our clients.
          </p>
        </div>
      </div>
    </div>
  );
}

export default About;
